
#define AxisAlignedBB::getBoundingBoxFromPool(minX, minY, minZ, maxX, maxY, maxZ) AxisAlignedBB::$nextBoundingBox >= count(AxisAlignedBB::$boundingBoxes) ? (AxisAlignedBB::$boundingBoxes[AxisAlignedBB::$nextBoundingBox++] = new AxisAlignedBB(minX, minY, minZ, maxX, maxY, maxZ)) : AxisAlignedBB::$boundingBoxes[AxisAlignedBB::$nextBoundingBox++]->setBounds(minX, minY, minZ, maxX, maxY, maxZ)
#define AxisAlignedBB::cloneBoundingBoxFromPool(bb) AxisAlignedBB::$nextBoundingBox >= count(AxisAlignedBB::$boundingBoxes) ? (AxisAlignedBB::$boundingBoxes[AxisAlignedBB::$nextBoundingBox++] = new AxisAlignedBB(bb ->minX, bb ->minY, bb ->minZ, bb ->maxX, bb ->maxY, bb ->maxZ)) : AxisAlignedBB::$boundingBoxes[AxisAlignedBB::$nextBoundingBox++]->setBounds(bb ->minX, bb ->minY, bb ->minZ, bb ->maxX, bb ->maxY, bb ->maxZ)